const currencyLoaded = (apiCurrency) => {
	return {
		type: 'CURRENCY_LOADED',
		payload: apiCurrency
	};
};

const convertibleCurrency = (v) => {
	return {
		type: 'CONVERTIBLE_CURRENCY',
		payload: v
	};
};

export {
	currencyLoaded,
	convertibleCurrency
};
